import React, { Component } from 'react';
import Chart from 'react-apexcharts';
import { Card } from '@blueprintjs/core';

export default class LineChart extends Component {
   constructor(props) {
      super(props);

      this.state = {
         options: {
            chart: {
               id: 'basic-bar',
               backgbackground: '#fff'
            },
            xaxis: {
               categories: [
                  1991,
                  1992,
                  1993,
                  1994,
                  1995,
                  1996,
                  1997,
                  1998,
                  1999
               ]
            },
            labels: {
               style: {
                  cssClass: 'bp3-card'
               }
            },
            axisBorder: {
               show: true,
               color: '#78909C',
               offsetX: 0,
               offsetY: 0
            }
         },
         series: [
            {
               name: 'series-1',
               data: [30, 40, 45, 50, 49, 60, 70, 91]
            }
         ]
      };
   }
   render() {
      return (
         <Card>
            <Chart
               options={this.state.options}
               series={this.state.series}
               type='bar'
               width='100%'
            />
         </Card>
      );
   }
}
